import { Component } from 'react';
import './App.css';

import Handlebars from "handlebars";

const html = `<div id="board">
                {{#each cells}}\
                  {{#if link}}\
                    <a href={{link}}><div class="cell {{clazz}}">{{text}}</div></a>\
                  {{else}}\
                    <div class="cell {{clazz}}">{{text}}</div>\
                  {{/if}}\
                {{/each}}\
              </div>\
              <div id="bottombar">\
                <a href="/newgame"><button>New Game</button></a>\
                <button>Undo</button>\
              </div>`;
const template = Handlebars.compile(html);

interface AppState {
  state: string
};

class App extends Component<{}, AppState> {
  async newGame() {
    const response = await fetch('http://localhost:8080/newGame');
    const json = await response.json();
    this.state = json.toString();
  };

  render() {
    return (
      <div className="App">
        <div dangerouslySetInnerHTML={{ __html: template(this.state) }} />
      </div>
    );
  }
}

export default App;
